import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header" >
        <input id="template"></input>
        <img src="https://wiki.guildwars.com/images/c/c1/Vow_of_Strength_%28large%29.jpg" alt=""></img>

      </header>
    </div>
  );
}

export default App;
